import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";

const ProfilePage = () => {
  const [getUsers, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((data) => {
        setUsers(data);
      });
  }, []);
  console.log(getUsers);

  return (
    <div className="profile">
      <div className="back">
        <Link to="/">
          <img
            src="https://image.shutterstock.com/image-vector/go-back-left-return-arrow-260nw-1452017738.jpg"
            alt=""
          />
        </Link>
      </div>
      <div>
        {getUsers.map((x, i) => (
          <div>
            <h1>{x.name}</h1>
            <p>{x.email}</p>
            <p>{x.website}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfilePage;
